import React from 'react';
import PropTypes from 'prop-types';

function Card({ image }) {
  return (
    <div className="d-steam-card-wrapper">
      <div className="d-steam-card" style={{ backgroundImage: `url(${image})` }}></div>
    </div>
  );
}

Card.propTypes = {
  image: PropTypes.string.isRequired,
};

export default Card;
